import React from "react";

const NavBar = () => (
    <nav className="bg-gray-800 text-white p-4">
        <ul className="flex justify-around">
            <li>Home</li>
            <li>Projects</li>
            <li>Skills</li>
            <li>Resume</li>
        </ul>
    </nav>
);

export default NavBar;
